export default class Root extends App {
  render() {
    const { Component, pageProps } = this.props;

    return (
      <Auth0Provider
        domain={process.env.DOMAIN}
        clientId={process.env.CLIENT_ID}
        redirectUri={process.env.REDIRECT_URI}
      >
        <EnvProvider>
        {/* <MyComponent> */}
          <Component {...pageProps} />
          </EnvProvider>
        {/* </MyComponent> */}
      </Auth0Provider>
    );
  }
}

